import React, { Component } from 'react';
import '../styles/content.scss'

class PageContent extends Component {
  constructor(props) {
    super(props);
    this.state = {

    };
  }

  render() {
    return (
      <div className="content-container">
        <div className="first-info-box">
          <p className="first-box-title">Who can request an Absentee Ballot?</p>
          <p className="first-box-information">Any registered Hanover voter can request a Hanover absentee ballot.
          You must be a registered member of the party whose primary you are voting in.
          If you are not affiliated with either party, you can declare your party affiliation
          on the absentee ballot request form and vote in a party’s primary.
          If you are affiliated with one party, to vote in the other party’s primary
          you can switch your party in person at the Town Hall. </p>
        </div>
        <div className="second-info-box">
          <p className="second-box-title">Who’s on the Ballot?</p>
          <p className="second-box-information">State primary elections decide
          the party nominees for every state-level candidate.
          These elections decide the party nominees for every office except
          President (including nominees for Senate and Congress, as well as
            Governor, state senator, and state representative). </p>
        </div>
        <div className="third-info-box">
          <p className="third-box-title">Why request an Absentee Ballot?</p>
          <p className="third-box-information">The New Hampshire state primary
          is on September 8, before orientation week and before students will be
          on campus for fall term. To vote in this election, Dartmouth students
          must submit a request for an absentee ballot and then mail in a
          completed ballot. </p>
        </div>
        <div className="fourth-info-box">
          <p className="fourth-box-title">What do I do when my Ballot comes?</p>
          <p className="fourth-box-information">Go to
          <a href="https://sos.nh.gov/WorkArea/DownloadAsset.aspx?id=8589993551">
          https://sos.nh.gov/WorkArea/DownloadAsset.aspx?id=8589993551</a>
          for instructions on how to fill out and submit your absentee ballot </p>
        </div>
      </div>
    );
  }
}

export default PageContent;
